  errno=0; \
  while ( (result = read( fileno(yyin), (char *) buf, max_size )) < 0 ) \
  { \
    if( errno != EINTR) \
    { \
      YY_FATAL_ERROR( "input in flex scanner failed" ); \
      break; \
    } \
    errno=0; \
    clearerr(yyin); \
  }\
\

